import React, {Component} from 'react';
import styled from  'styled-components';
import loginAxios from '../Axios/LoginAxios';

class Login extends Component {
    render() {
        return(
            <div>
                <LoginForm>
                    <LoginText>로그인</LoginText>
                    <LoginInput>
                    <div> 
                    <input type='text' className='id' placeholder='아이디'></input>
                    </div>
                   <div>
                   <input type='text' className='password' placeholder='비밀번호'></input>
                   </div>
                   </LoginInput>
                   <LoginBtn>
                       로그인                  
                   </LoginBtn>
                </LoginForm>
            </div>
        )
    }
}

export default Login;

const LoginText = styled.h1`
    color: #00587a;
    margin-left:30px;
 
`
const LoginInput = styled.div `
    margin-left:40px;
`
const LoginForm = styled.div`
    margin-top: 180px;
    text-align:center;
`
const LoginBtn = styled.div`
   margin-left:30px;
   margin-top:30px;
   
`
